def count_factorials_with_n_trailing_zeros(n: int) -> int:

    def cal(n: int) -> int:
        count = 0
        i = 5
        while True:
            if n // i >= 1:
                count += n // i
                i *= 5
            else:
                break
        return count
    low = 2
    high = n * 5
    ans = 0
    while low <= high:
        mid = low + (high - low) // 2
        temp = cal(mid)
        if temp == n:
            ans = mid
            break
        elif temp > n:
            high = mid - 1
        else:
            low = mid + 1
    if ans == 0:
        return 0
    return 5

